import React from "react";

const Navbar9 = ({onClick}) => {
    return(
        <>
        
       
        <div className="fixed-bottom floating-action-button" style={{ right:'1.5rem', bottom:'10px', right:'10px', zIndex:'99'}}>
        
      <button className="btn btn-primary btn-lg float-end"  onClick={ onClick} style={{backgroundColor:'#00262b', padding:'15px 25px', marginBottom:'1.6rem',}}>
      <img src="https://www.edx.org/images/experiments/xpert/xpert-logo.svg" style={{width:'80px'}}>
      </img>
      </button>
      <div tabIndex="-1" role="dialog" aria-modal="true" data-testid="floating-action-popup" class="floating-popup">
        <div class="d-flex flex-clumn justify-content-between h-100">
            
        </div>
      </div>

    </div>
        </>
    )
}
 export default Navbar9;
